import React from 'react';
import './App.css';
import {Route, BrowserRouter as Router, Routes} from 'react-router-dom';
import EventList from "./components/EventList";
function App() {
  return (
    <Router>
       <Routes>
         <Route exact path="/" component={EventList} />
       </Routes>
    </Router>
  );
}
export default App;
